curried
柯里化装饰器被装饰函数调用时，先展开 partial 查看已经绑定的参数个数。如果和函数初始定义时个数一致，调用函数并返回值；如果少于函数定义时的个数，使用 partial 包装后返回 curried。

def curried(func):
    @wraps(func)
    def _curried(*args, **kwargs):
        f = func
        count = 0
        while isinstance(f, partial):
            if f.args:
                count += len(f.args)
            # parial 保存有 func 属性
            f = f.func
        # while 结束，f 变为最原始未被装饰的函数
        # getargspec 获取最初的被装饰函数的参数信息
        spec = getargspec(f)

        if count == len(spec.args) - len(args):
            return func(*args, **kwargs)

        return curried(partial(func, *args, **kwargs))
    return _curried
